  FaGrinHearts,
  FaHeart,
  FaHeartbeat,
  FaKissWinkHeart,
  FaRegHeart,
  FaThumbsUp,
} from "react-icons/fa";

export default function PostLike() {
  return (
    <>
      <FaHeart />
      <FaKissWinkHeart />
      <FaHeartbeat />
      <FaThumbsUp />
      <FaRegHeart />
      <FaGrinHearts />
    </>
  );
}
